import React from "react";
import "./App.css";
import Loginimg from "./componetc/Loginimg";
import { Route, Routes } from "react-router-dom";
import Dashbord from "./componetc/dashbord/Bord";


function App() {
  return (
    <>
      <switch>
        <Routes>
          <Route exact path="/" Component={Loginimg} />
        </Routes>
        <Routes>
          <Route path="/Bord" Component={Dashbord} />
        </Routes>
      </switch>

    </>
  );
}

export default App;
